(458, 'exam_mark_instruction', 'Please ensure Exam Schedule and Exam Attendance before Exam Mark Entry.', '          ', 'Por favor asegrese de Horario de Examen y Asistencia al Examen antes de la Entrada de la Marca de Examen.', '          .', '           ', '            .', '', '', 'Por favor, assegure o horrio de exame e a participao no exame antes da entrada na marca do exame.', ', ,          .', 'Veuillez vous assurer de respecter le calendrier des examens et la participation aux examens avant lentre  lexamen.', '        .', 'Bitte stellen Sie sicher, dass der Prfungsplan und die Anwesenheit der Prfung vor der Eintragung der Prfungsnote eingehalten werden.', 'Si prega di assicurare la pianificazione degli esami e la frequenza degli esami prima delliscrizione.', ' Mark Entry', 'Krjk, gyzdjn meg arrl, hogy az Exam Mark Entry s Exam Attendance Exam Mark Entry eltt van.', 'Zorg ervoor dat het examenrooster en het examen aanwezig zijn vr de inzending van het examen.', 'Test Morbi rhoncus velit, ut et IV ante Attendance Mark Test Entry.', 'Harap pastikan Jadwal Ujian dan Ujian Kehadiran sebelum Entri Tanda Ujian.', 'Snav iareti girmeden nce ltfen Snav Takvimi ve Snav Ekibinden emin olunuz.', '           .', '                   .', 'Sila pastikan Jadual Peperiksaan dan Kehadiran Peperiksaan sebelum Kemasukan Tanda Peperiksaan.', '          .', '        .', '          .', 'Naley upewni si, e harmonogram egzaminw i udzia w egzaminach poprzedz wejcie do egzaminu.', ' ,           .', '           .', 'Asigurai-v c ai verificat programul de examen i examenul nainte de nscrierea n examen.', ' Entry ', 'Jw e idaniloju Akoko Idaduro ati Akok Ibwo aaju tit Aksil Aksil.', 'Da fatan a tabbatar da Gwargwadon Binciken da Jarraba Tambaya kafin jarrabawar Mark Mark.', NULL),
(459, 'mark_sheet_instruction', 'Please ensure Exam Attendance and Exam Mark to find Mark Sheet.', '          ', 'Asegrate de que la Asistencia al examen y la Marca del examen encuentren la Hoja de calificaciones.', '         .', '             ', '                .', '', '', 'Certifique-se da presena do exame e da marca do exame para encontrar a folha de marca.', ', ,      ,   Mark Sheet.', 'Veuillez vous assurer de la prsence  lexamen et de la note dexamen pour trouver la feuille de notes.', '       .', 'Bitte stellen Sie sicher, dass die Prfungsteilnahme und die Prfungsnote Mark-Sheet finden.', 'Si prega di assicurare la partecipazione agli esami e il marchio dellesame per trovare il foglio dei voti.', ' Mark Sheet', 'Krjk, hogy az Exam Attendance s a Exam Mark-ot tallja meg a Mark Sheet-et.', 'Zorg ervoor dat u een examenformulier en een examencertificaat aantreft om het beoordelingsformulier te vinden.', 'Placere operam ad inveniendum Mark Mark Chapter OMNIBUS June IV Sheet.', 'Harap pastikan Ujian Kehadiran dan Tanda Ujian untuk menemukan Lembar Tandai.', 'Marka Belgesini bulmak iin ltfen Snav Devamn ve Snav aretini salayn.', '              .', '                .', 'Sila pastikan Kehadiran Peperiksaan dan Ujian Peperiksaan untuk mencari Mark Sheet.', '         .', '        .', '         .', 'Prosimy o upewnienie si, e obecno na egzaminie i znak egzaminu jest zaznaczona.', ' , ,        .', '              .', 'Asigurai-v c ai participat la examen i la examen pentru a gsi o coal Mark.', '', 'Jowo rii daju pe idaduro Ijadii ati aywo Marku lati wa Mark Sheet.', 'Da fatan a tabbatar da Hannun Binciken da Takaddun Mark don neman Mark Sheet.', NULL),
