(464, 'promotion_instruction_4', 'Please double check all Students Total Marks, Obtain Mark, Average Grade Point & Next Class Roll No.', '     ,  ,          ', 'Verifique por favor todas las marcas totales de estudiantes, obtenga la marca, el promedio de calificaciones y la siguiente clase.', '                   ', ' ,  ,  ,          ', '                    ', '', '', 'Por favor, verifique novamente todas as Marcas Total de Estudantes, Obter Marca, Ponto Mdico e Prxima Classe Roll No.', ',    ,   ,  ,     .', 'Veuillez vrifier toutes les notes totales des lves, obtenir la note, la note moyenne et la prochaine classe', '   ,  ,          .', 'Bitte berprfen Sie alle Schler-Gesamtpunkte, erhalten Sie Mark, Durchschnittspunkt und nchste Klasse Roll-Nr.', 'Si prega di ricontrollare tutti gli indicatori Total Marks, Obtain Mark, Average Grade Point e Next Class.', ', , ', 'Krem, ellenrizze az sszes dikok teljes pontszmt, szerezze meg a pontszmot, tlag pontot s a kvetkez osztly tekercset.', 'Controleer alsjeblieft alle studenten totaalcijfers, cijfer behalen, gemiddelde cijferpunt en volgende klasserol nr.', 'Velit gemino reprehendo omnes alumni Romanum marcas, Mark Alleluia, & mediocris gradus punctum Next Class Roll No.', 'Harap periksa kembali semua Siswa Total Marks, Dapatkan Mark, Rata-rata Nilai Kelas & Gulungan Kelas Berikutnya No.', 'Ltfen tm rencilerin Toplam aretlerini, aretle, Ortalama Puan Puan ve Sonraki Snf Rulo Numarasn kontrol edin.', '       ,   ,        ', '                ', 'Sila semak semula semua Markah Jumlah Pelajar, Dapatkan Tanda, Nilai Gred Purata & No.', '    , ,    &      .', '  , ,          .', '       , ,         .', 'Sprawd dokadnie wszystkie oceny uczniw, zdobd ocen, redni ocen i numer nastpnej klasy', ' ,      ,  ,       Roll No.', '        ,   ,        ', 'Verificai dublu toi studenii Mark Total, Obinei marca, Punctul mediu i urmtoarea clas Roll Nr.', ' & Next  Roll, ,  Marks  .', 'Jw e aywo lmeji gbogbo Awn akk Awn ami ni gbogbo, Gba Sam