(465, 'promotion_instruction_5', 'All things are 100% correct Then Promote Students to Next Class.', ' 100%       ', 'Todas las cosas son 100% correctas. Luego, promueva a los estudiantes a la siguiente clase.', '   100      .', '  100%  ,        ', '  100          .', '100', '100', 'Todas as coisas esto 100% corretas. Em seguida, promova alunos para a prxima classe.', '   100% .      .', 'Toutes les choses sont 100% correctes Puis promouvoir les tudiants  la prochaine classe.', '  100 % .      .', 'Alle Dinge sind zu 100% korrekt. Dann frdern Sie die Schler zur nchsten Klasse.', 'Tutte le cose sono corrette al 100%, quindi promuovi gli studenti alla prossima lezione.', ' 100% ', 'Minden dolog 100% -ban helyes, majd elsegti a dikokat a kvetkez osztlyba.', 'Alle dingen zijn 100% correct. Promoot vervolgens studenten naar de volgende klas.', 'Et bene omnia sunt, C% Next Promovere studentibus ad generalia Ps.', 'Semua hal 100% benar Lalu Promosikan Siswa ke Kelas Selanjutnya.', 'Her ey% 100 dorudur Sonra rencileri Bir Sonraki Snfta Tantn.', '    100%         .', '  100           .', 'Semua perkara adalah 100% betul Kemudian Menggalakkan Pelajar ke Kelas Seterusnya.', '  100% ,       .', '  100% ,     .', '  100%        .', 'Wszystkie rzeczy s w 100% poprawne Nastpnie promuj uczniw do nastpnej klasy.', '    100%.      .', '  100%  .        .', 'Toate lucrurile sunt 100% corecte Apoi promoveaz elevii n clasa urmtoare.', ' Next  100% ', 'Gbogbo ohun ni o wa 100% atune Lhinna da Awn Ile-iwe si Kilasi Oju.', 'Dukkanin abubuwa 100% daidai Saan nan kuma addara aliban zuwa Kashi na gaba.', NULL),
