(538, 'fee_type_instruction_hostel_1', 'Hostel Fee Amount Will be define in Hostel Room creation time.', '        ', 'El importe de la tarifa del albergue se definir en el tiempo de creacin de la habitacin del albergue.', '    Hostel Hostel     Hostel Hostel.', '            ', '              ', 'Hostel Fee AmountHostel Room', '', 'O valor da taxa do albergue ser definido no horrio de criao do quarto do albergue.', '        .', 'Montant des frais dauberge Sera dfini lors de la cration de la chambre dauberge.', '       .', 'Hostel-Gebhrenbetrag Wird in der Erstellungszeit des Hostel-Zimmers definiert.', 'L\'importo della tassa di ostello sar definito al momento della creazione della stanza dell\'ostello.', '', 'A hosteldj sszegt a Hostel szoba ltrehozsnak idejn hatrozzuk meg.', 'Hostel Fee Bedrag zal worden bepaald in het creren van Hostel Room.', 'Hostel hostel volutpat pretium moles erit define creaturae est in tempore.', 'Jumlah Biaya Hostel akan ditentukan dalam waktu pembuatan Kamar Hostel.', 'Hostel creti Tutar, Hostel Odas oluturma sresinde tanmlanacaktr.', 'Hostel         .', '          .', 'Jumlah Bayaran Kos Asrama Akan ditentukan dalam Asrama Masa penciptaan bilik.', '       .', '       .', '          .', 'Kwota opaty za hostel zostanie okrelona w czasie tworzenia pokoju w hostelu.', '         .', '              .', 'Valoarea tarifelor pentru hostel va fi definit n timpul de creare a camerei Hostel.', '', 'Iye iye ayagbe Ile ayagbe ni yoo e alaye ni akoko da ti Ile ayagbe.', 'Adadin Dakunan kwanan Dakunan kwanan za a ayyana a lokacin irirar Room Dakunan kwanan yara.', NULL),
(539, 'fee_type_instruction_hostel_2', 'From here must be create Hostel Fee Title to create Hostel Fee Invoice.', '             ', 'A partir de aqu debe crearse el Ttulo de tarifa de albergue para crear la Factura de tarifa de albergue.', '      Hostel Hostel   Hostel Fee.', '  Hostel Fee Invoice    Hostel Fee Title  ', '             ', 'Hostel Fee TitleHostel Fee Invoice', '', 'A partir daqui, deve ser criado o ttulo da taxa do albergue para criar a fatura da taxa do albergue.', '   Hostel Fee Title   Hostel Fee Invoice.', 'Crez un titre de taxe dauberge pour crer une facture de taxe dauberge.', '        .', 'Von hier aus muss ein Hostelgebhrentitel erstellt werden, um eine Hostelgebhr-Rechnung zu erstellen.', 'Da qui  necessario creare il titolo della tariffa dell\'ostello per creare la fattura della quota dell\'ostello.', '', 'Innentl ltre kell hozni a Hostel Dj cmt a Hostel Dj szmla ltrehozshoz.', 'Vanaf hier moet Hostel Fee Titel worden gemaakt om Hostel Fee Factuur te maken.', 'Hinc oportet creare hostel hostel pretium pretium Titulus creare cautionem.', 'Dari sini harus dibuat Judul Biaya Hostel untuk membuat Faktur Biaya Hostel.', 'Buradan Pansiyon creti Faturas oluturmak iin Pansiyon creti Bal oluturulmaldr.', '         Hostel       Hostel.', '    Hostel Fee          .', 'Dari sini mesti mewujudkan Title Fee Hostel untuk membuat Invois Bayaran Hostel.', '         .', '         .', '           .', 'Std naley utworzy tytu opaty za hostel, aby utworzy faktur za opat za hostel.', '     ,   -  .', '             .', 'De aici trebuie s se creeze titlul de taxe pentru pensii pentru a crea factura de taxe la hostel.', '', 'Lati ibi gbd j da Akle ayagbe Ile ayagbe lati da Invoice Ile ayagbe hostel.', 'Daga nan dole ne a iriri taken Dakunan kwanan Mai ba da izini don irirar Injin Dadi Mai masaukin baki.', NULL),
(540, 'fee_type_instruction_transport_1', 'Transport Fee Amount Will be define in Transport Route creation time.', '         ', 'El importe de la tarifa de transporte se definir en el tiempo de creacin de la ruta de transporte.', '         .', '          ', '               ', '', '', 'O valor da taxa de transporte ser definido no horrio de criao da rota de transporte.', '         .', 'Le montant des frais de transport sera dfini dans l\'heure de cration de l\'itinraire de transport.', '       .', 'Der Betrag der Transportgebhr wird in der Erstellungszeit des Transportwegs definiert.', 'L\'importo della tassa di trasporto verr definito al momento della creazione della rotta di trasporto.', '', 'A szlltsi dj sszegt a szlltsi tvonal ltrehozsi ideje hatrozza meg.', 'Het bedrag van de transportkosten wordt bepaald in de aanmaaktijd van de transportroute.', 'Aliquam pretium onerariam navem onerariam in define voluntas creaturae Iter itineris est.', 'Jumlah Biaya Transportasi akan ditentukan dalam waktu pembuatan Rute Transportasi.', 'Nakliye creti Tutar, Nakliye Rotas oluturma sresinde tanmlanacaktr.', '         .', '              .', 'Jumlah Bayaran Pengangkutan Akan ditentukan dalam Masa Penjanaan Laluan Pengangkutan.', '       .', '       .', '         .', 'Wysoko opaty transportowej zostanie okrelona w czasie tworzenia trasy transportowej.', '        .', '            .', 'Valoarea tarifelor de transport va fi definit n timpul de creare a traseului de transport.', '', 'Iye isanwo Irin Yoo alaye ni akoko Irin Irin.', 'Adadin Kudin Sufuri Zai Iya Bayyanawa a Lokacin Hada Jirgin Sama.', NULL),
(541, 'fee_type_instruction_transport_2', 'From here must be create Transport Fee Title to create Transport Fee Invoice.', '             ', 'A partir de aqu debe crearse el Ttulo de tarifa de transporte para crear la Factura de tarifa de transporte.', '          .', '  Transport Fee Invoice    Transport Fee Title  ', '            ', '', '', 'A partir daqui, deve ser criado o ttulo da taxa de transporte para criar a fatura da taxa de transporte.', '     ,       .', ' partir de l, vous devez crer un titre de frais de transport pour crer une facture de frais de transport.', '      .', 'Von hier aus muss der Transportgebhrentitel erstellt werden, um die Transportgebhrenrechnung zu erstellen.', 'Da qui deve essere creato il titolo della tassa di trasporto per creare la fattura della tassa di trasporto.', '', 'Innentl ltre kell hozni a szlltsi dj cmt a szlltsi dj szmla ltrehozshoz.', 'Vanaf hier moet u Transporttitel maken om Transportfactuurfactuur te maken.', 'Hinc oportet creare pretium onerariam Titulus creare pretium onerariam cautionem.', 'Dari sini harus dibuat Judul Biaya Transportasi untuk membuat Faktur Biaya Transportasi.', 'Buradan, Tama creti Faturas oluturmak iin Tama creti Bal oluturulmaldr.', '            .', '                 .', 'Dari sini mesti mencipta Tajuk Bayaran Pengangkutan untuk membuat Invois Bayaran Pengangkutan.', '         .', '         .', '   oice        .', 'Std naley utworzy tytu opaty transportowej, aby utworzy faktur opaty transportowej.', '     ,      .', '            .', 'De aici trebuie s se creeze titlul comisionului de transport pentru a crea factura taxelor de transport.', '', 'Lati ibi gbd wa ni da Akl owo ya lati da Invoice Fee Invoice.', 'Daga nan dole ne a iriri Fati Fee Title don irirar Lissafin Kui na Kui.', NULL),
