INSERT INTO `schools` (`id`, `school_name`, `school_code`, `registration_date`, `address`, `phone`, `email`, `currency`, `currency_symbol`, `footer`, `logo`, `frontend_logo`, `academic_year_id`, `academic_year`, `school_fax`, `school_lat`, `school_lng`, `map_api_key`, `zoom_api_key`, `zoom_secret`, `enable_frontend`, `enable_online_admission`, `final_result_type`, `language`, `theme_name`, `about_text`, `about_image`, `enable_rtl`, `facebook_url`, `twitter_url`, `linkedin_url`, `google_plus_url`, `youtube_url`, `instagram_url`, `pinterest_url`, `status`, `created_at`, `modified_at`, `created_by`, `modified_by`) VALUES
(1, 'THE 381TECH SCHOOL', 'TESS-04', '01-01-2015', 'Islamabad, Pakistan', '03174923348', 'engr.ali007@outlook.com', 'PKR', 'Rs.', 'Copyright  Delta Soft Islamabad 2020-21', '1675569976-school-admin-logo.jpg', '1675569976-school-front-logo.jpg', 1, '2021 - 2022', '051-4952632', '', '', '', '', '', 1, 1, 1, 'english', 'navy-blue', '<span style=\"font-family: \" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 16px;\"=\"\">\"THE EDUCATORS\" envisions quality education as the key resource for national development, delivered to a cross section of our society through sustainable projects. Mission Statement: \"THE EDUCATORS\"</span><p style=\"margin-bottom: 0px; line-height: 30px; font-size: 16px; padding: 0px 0px 40px; font-family: &quot;Open Sans&quot;, sans-serif;\">Established in 2002 in Pakistan, The Educators is a parallel private school network owned and operated by Beaconhouse that aims to impart a standardized quality of education across the nation at a tuition fee that is a fraction of the fee charged at Beaconhouse. The Educators operates through a model of network associates (franchisees) in which Beaconhouse is the franchisor/service provider.</p><p></p><p style=\"margin-bottom: 0px; line-height: 30px; font-size: 16px; padding: 0px; font-family: &quot;Open Sans&quot;, sans-serif;\">Leveraging on 17 years of success and experience in education, The Educators has experienced phenomenal growth to become the country\'s largest school network. With over 900+ Schools and a student body exceeding 200,000+, The Educators has created over 9,000 job opportunities in a relatively short period of time. The overall aim of the organization is to provide a quality learning environment for students and quality training for the faculty through excellence in education within the relevant socio-cultural framework of Pakistan. The Educators\' success lies both in its strong brand as well as its ability to continuously add new products and services for its Network Associates.</p>', '1591557275-about-image.jpg', 0, 'https://www.facebook.com/', 'https://www.twitter.com/', 'https://www.linkedin.com/', 'https://plus.google.com/', 'https://www.youtube.com/', 'https://www.instagram.com/', 'https://www.pinterest.com/', 1, '2017-08-23 09:40:28', '2023-02-21 16:03:07', 1, 1),
(2, 'The 3TECHNO SCHOOL', 'TES-007', '01-01-2016', 'Bhara Kahu, Islamabad', '051-5645421', 'info@edu.pk', 'PKR', 'Rs.', 'System Provided by Delta Software Services Islamabad. 0317-4923348', '1675570360-school-admin-logo.jpg', '1675570360-school-front-logo.jpg', 2, '2023 - 2024', '', '', '', '', '', '', 1, 1, 0, 'english', 'dodger-blue', '<span style=\"font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18px;\">From its modest beginnings in 1975 when it opened its first Les Anges Montessori Academy for toddlers, Beaconhouse has extended its reach through a global education network that is now one of the largest in the world. An organisation that values its heritage while it continues to reinvent its educational provision to meet the needs of a future generation, Beaconhouse is now a major force in the education world, with an ever-expanding base already established in the UK, Malaysia, the Philippines, Thailand, Pakistan, the UAE, Oman, Bangladesh and Indonesia. Dynamic and constantly evolving, Beaconhouse provides an innovative and progressive education to 308,000 students worldwide with an unprecedented diversity in age, socio-economic background, and nationality.</span>', NULL, 0, '', '', '', '', '', '', '', 1, '2021-07-08 13:59:01', '2023-02-08 11:09:47', 1, 1);
